import React, { Component } from "react";
import olinCounts from "./imgs/olinCounts.png";

class Home extends Component {
      render() {
            return (
                  <>
                        <div id="header">
                              <img src={olinCounts} id="mainLogo" alt="logo" />
                        </div>
                        <div id="flexContainer1">
                              <div id="sidebar"> 
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              <button type="button" class="btn btn-primary sideBarButton">Primary</button>
                              </div>
                              <div id="mainContent">
                                    <div class="redBanner"> Latest Counts </div>
                                    <div id="latestCounts">  </div>

                                    <div class="redBanner"></div>
                                    <div id="busiestRooms"></div>

                                    
                              </div>
                        </div>
                  </>
            );
      }
}

export default Home;
